import * as ActionTypes from "../../actions/Types";
import { createDietician } from "../initialState";

const createDieticianReducer = (state = createDietician, action) => {
  switch (action.type) {
    case ActionTypes.CREATE_DIETICIAN_FAIL:
      console.log('failed')
      return {
        isCreated: false,
        error: action.payload.message,
      };
    case ActionTypes.CREATE_DIETICIAN_SUCCESS:
      return {
        isCreated: true,
        data: action.payload,
      };
    case ActionTypes.CREATE_DIETICIAN_DEFAULT:
      return {
        isCreated: false,
        data: null,
        error: null,
      };
    default: 
      return state;
  }
};

export default createDieticianReducer;
